import React, {useEffect, useState} from 'react';
import NavBar from '../../components/NavBar/NavBar';
import Axios from 'axios';
import { useHistory } from 'react-router-dom';

export default function LikedPostPage() {
    const history = useHistory();

    const [role, GetUserRole] = useState('')

    useEffect(() => {
        Axios.get("http://localhost:3001/getaccount").then((result) => {
            if (result.data.loggedIn === true) {
                GetUserRole(result.data.user[0].role)
                Axios.get("http://localhost:3001/confession/userliked/getall").then((response) => {
                    if (response.data) {
                        console.log(response.data)
                    }
                })
            }
            else {
                history.push("/")
            }
        });
    }, []); // remove the , [] later on 
    
    return (
        <div className="liked-post-page">
            <div className="navBarDiv">
                <NavBar/>
            </div>
            <div className="homeHeader">
                <h1>Your Liked Confession</h1>
            </div>
            <div>

            </div>
        </div>
    )
}
